];

export default function EarningAgent() {


  const [Users, fetchUsers] = useState([])

  const getData = () => {
    fetch('https://localhost:8080/api/accounts/all')
      .then((res) => res.json())
      .then((res) => {
        console.log(res)
        fetchUsers(res)
      })
  }

  useEffect(() => {
    getData()
  }, [])
  return (
    <Section>
    <div className="top">
      <div className="info">
        <h5>your current Balance</h5>
        <h1>12682.555 Birr</h1>
        <BiWallet className='logo'/>
        <div className="growth">
        <h2>React Fetch API Example</h2>
      <ul>
        {Users.map((item, i) => {
          return <li key={i}>{item.firstname}</li>
        })}
      </ul>
          <span>+2.45%</span>
        </div>
      </div>
    </div>
    <div className="chart">
      <ResponsiveContainer width="100%" height="100%">
        <AreaChart
          width={500}
          height={400}
          data={data}
          margin={{ top: 0, left: 0, right: 0, bottom: 0 }}
        >
          <Tooltip cursor={false} />
          <Area
            animationBegin={800}
            animationDuration={2000}
            type="monotone"
            dataKey="data"
            stroke="#ffc107"
            fill="#8068233e"
            strokeWidth={4}
          />
        </AreaChart>
      </ResponsiveContainer>
    </div>
  </Section>
  )
}
